INSERT INTO `adminnotification_inbox` VALUES (1,4,'2016-01-13 22:52:11','Have questions? Magento has big answers at Imagine Commerce.','Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ','http://imagine.magento.com',0,0),(2,1,'2016-01-20 22:17:09','Important: Install Magento Community Edition 2.0.1 for Security & Functional Updates – 1/20/2016','Today, we are releasing Magento Community Edition 2.0.1 to improve the security and functionality of Magento 2.0 sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. Community Edition 2.0.1 also includes USPS API updates and support for PHP7.0.2, which enables dramatic performance improvements and other benefits. You can download the release from the Community Edition Download Page or by using Composer. Learn more at https://magento.com/security/patches/magento-201-security-update. \n','https://magento.com/security/patches/magento-201-security-update',0,0),(3,1,'2016-01-29 00:08:45','Important: Magento Community Edition 2.0.2 Addresses Upgrade Issues – January 28, 2016','Newly released Magento Community Edition 2.0.2 resolves issues encountered by some users when upgrading Magento Community Edition 2.0.0 and 2.0.1. The issues occur with products that were installed from a compressed archive (.tar.gz, .zip, and .bz2); merchants who used other installation options are not affected. More information is available in the Technical Bulletin at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html. ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html',0,0),(4,1,'2016-03-31 00:24:35','Magento Community Edition 2.0.3 Includes Functional and Security Updates – 3/30/2016','Magento Community Edition 2.0.3 is now available and contains important security updates, as well as performance improvements and functional enhancements. Full details on the functional enhancements are included in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.3CE.html. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-203-security-update.','https://magento.com/security/patches/magento-203-security-update',0,0),(5,1,'2016-04-01 06:40:23','New Release: Magento Community Edition 2.0.4 – 3/31/2016','We have released Magento Community Edition 2.0.4 to address a packaging issue with yesterday’s release. If you have already installed Enterprise Edition 2.0.3, you must replace it with the new version to ensure that your site receives all security enhancements. Learn more at https://magento.com/security/patches/magento-204-security-update','https://magento.com/security/patches/magento-204-security-update',0,0);
